import './App.css';
import Nav from './components/Nav';
import Home from './components/Home';
import Aulas from './components/Aulas';
import Sobre from './components/Sobre';
import Aula from './components/Aula';
import Assitir from './components/Assistir';

import {BrowserRouter, Routes, Route} from 'react-router-dom';
import {Provider} from 'react-redux';
import { createStore } from 'redux';
import loginReducer from './reducers/loginReducer';
import PrivateRoute from './components/PrivateRoute';

const store = createStore(loginReducer);

function App() {
  return (
    <Provider store={store}>
    <BrowserRouter>
      <div className="App">   
        <Nav />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/aulas/:id" element={<Aula />} />
          <Route path="/aulas" element={<PrivateRoute> <Aulas /> </PrivateRoute>} />
          <Route path="/sobre" element={<Sobre />} />
          <Route path="/assistir" element={<Assitir />} />
          <Route path="*" element={
            <div><h2>ERRO: 404 <br/> PAGINA N√ÉO ENCONTRADA</h2></div>
          } />
        </Routes>
      </div>
    </BrowserRouter>
    </Provider>
  )
}

export default App;
